export default function Gallery() {
  const [index, setIndex] = useState(0);
  const [showMore, setShowMore] = useState(false);
  const hasBack = index > 0;
  const hasNext = index < avengerList.length - 1;

  function handleBackClick() {
    if (hasBack) {
      setIndex(index - 1);
    } else {
      setIndex(avengerList.length - 1);
    }
  }

  function handleNextClick() {
    if (hasNext) {
      setIndex(index + 1);
    } else {
      setIndex(0);
    }
  }

  function handleMoreClick() {
    setShowMore(!showMore);
  }

  let avenger = avengerList[index];
  return (
    <>
      <h1>
        Frunez Shyna Cayanan
      </h1>
      <button className='UpperButton' onClick={handleBackClick}>
        Back
      </button>
      <button className='UpperButton' onClick={handleNextClick}>
        Next
      </button>
      <h2>
        <i>{avenger.name} </i>
      </h2>
      <h3>
        ({index + 1} of {avengerList.length})
      </h3>
      <button onClick={handleMoreClick}>
        {showMore ? 'Hide' : 'Show'} details
      </button>
      {showMore && <p>{avenger.description}</p>}
      <img
        src={avenger.url}
        alt={avenger.alt}
      />
    </>
  );
}
